const tasks = [
    {
        id:1,
        day:'Doctors Appointment' ,
        reminder : true ,
    },
    {
        id:2,
        day:'meeting at school' ,
        reminder : true ,
    },
    {
        id:3,
        day:'Feb 6th at 1:30pm' ,
        reminder : false ,
    }
]
export class Tasks extends Components {
    render() {
        return (
            <>
            {tasks.map((task)=>(
                <h3>{task.day}</h3>
            ))} 
            </>
        )
    }
}

export default Tasks
